CREATE SCHEMA db2;

CREATE TABLE db2.TAB_FIELD_TYP_DEF
(
    ID      INTEGER  NOT NULL,
    F_TYP           SMALLINT NOT NULL,
    F_TYP_ART    SMALLINT NOT NULL CHECK (F_TYP_ART IN (0, 1, 2, 3, 4, 5)),
    FIELD_NAME  CHAR(30),
    VISIBLE SMALLINT NOT NULL CHECK (VISIBLE IN (0, 1)),
    CHANGABLE SMALLINT NOT NULL CHECK (CHANGABLE IN (0, 1)),
    RESERVED SMALLINT NOT NULL CHECK (RESERVED IN (0, 1)),
    PRESETABLE SMALLINT NOT NULL CHECK (PRESETABLE IN (0, 1)),
    PRESET_VALUE CHAR(100),
    MIN_VALUE   BIGINT WITH DEFAULT NULL,
    MAX_VALUE   BIGINT WITH DEFAULT NULL,
    RESTRICTED CHAR(1) NOT NULL,
    PRIMARY KEY (ID)
);

